// Extract and validate webhook payload
const payload = $input.first().json.body || $input.first().json;

// Default values if not provided
const requestData = {
  eventType: payload.eventType || "Technology Conference",
  eventGoals: payload.eventGoals || "Engaging and innovative sessions",
  audienceSize: payload.audienceSize || 500,
  preferredTopics: payload.preferredTopics || ["AI", "Cloud Computing", "Innovation"],
  sessionCount: payload.sessionCount || 5,
  requestId: payload.requestId || Date.now().toString(),
  timestamp: new Date().toISOString(),
  source: payload.source || "voice-agent"
};

return { json: requestData };

// Get data from all previous nodes
const requestData = $input.all()[0].json;
const speakers = $input.all()[1].json;
const audienceData = $input.all()[2].json;

// Combine and structure data for AI analysis
const combinedData = {
  request: requestData,
  speakers: Array.isArray(speakers) ? speakers : [speakers],
  audienceInterests: Array.isArray(audienceData) ? audienceData : [audienceData],
  eventDetails: {
    type: requestData.eventType,
    goals: requestData.eventGoals,
    audienceSize: requestData.audienceSize,
    preferredTopics: requestData.preferredTopics,
    sessionCount: requestData.sessionCount
  },
  metadata: {
    requestId: requestData.requestId,
    timestamp: requestData.timestamp,
    source: requestData.source
  }
};

return { json: combinedData };

// Parse AI response and format recommendations
const aiResponse = $json.text || $json.message || JSON.stringify($json);
const requestMetadata = $input.first().json.metadata || {};

let recommendations;
try {
  // Extract JSON from the response
  const jsonMatch = aiResponse.match(/\{[\s\S]*\}/);
  if (jsonMatch) {
    recommendations = JSON.parse(jsonMatch[0]);
  } else {
    // Try parsing the entire response
    recommendations = typeof aiResponse === 'string' ? JSON.parse(aiResponse) : aiResponse;
  }
} catch (error) {
  recommendations = {
    error: "Error parsing recommendations: " + error.message,
    rawResponse: aiResponse.substring(0, 500)
  };
}

// Format for output and voice agent response
const formattedOutput = {
  status: "success",
  requestId: requestMetadata.requestId || "unknown",
  timestamp: new Date().toISOString(),
  source: requestMetadata.source || "unknown",
  totalRecommendations: recommendations.recommendations?.length || 0,
  recommendations: recommendations.recommendations || [],
  alternativeSpeakers: recommendations.alternativeSpeakers || [],
  eventOptimization: recommendations.eventOptimizationSuggestions || "",
  diversityScore: recommendations.diversityScore || 0,
  topicCoverage: recommendations.topicCoverage || [],
  summary: recommendations.summary || "Recommendations generated successfully",
  voiceResponse: generateVoiceResponse(recommendations)
};

function generateVoiceResponse(data) {
  if (!data.recommendations || data.recommendations.length === 0) {
    return "I apologize, but I couldn't generate speaker recommendations at this time. Please try again.";
  }

  const topSpeaker = data.recommendations[0];
  const speakerCount = data.recommendations.length;

  return `I've analyzed your event requirements and found ${speakerCount} excellent speaker matches. ` +
         `My top recommendation is ${topSpeaker.speakerName} for a ${topSpeaker.sessionFormat} on ${topSpeaker.sessionTopic}. ` +
         `This speaker has a match score of ${topSpeaker.matchScore}% and would be perfect because ${topSpeaker.reasoning.substring(0, 150)}. ` +
         `Would you like to hear more details about this speaker or the other ${speakerCount - 1} recommendations?`;
}

return { json: formattedOutput };

// Generate error response for voice agent
const errorData = $input.first().json;

const errorResponse = {
  status: "error",
  requestId: errorData.requestId || "unknown",
  timestamp: new Date().toISOString(),
  error: errorData.error || "Unable to generate recommendations",
  voiceResponse: "I apologize, but I encountered an issue while generating speaker recommendations. This could be due to insufficient data or a temporary system issue. Please try again or provide more specific event details.",
  recommendations: [],
  totalRecommendations: 0
};

return { json: errorResponse };
